import React from 'react';
import {
  ComposableMap,
  Geographies,
  Geography,
} from 'react-simple-maps';

const geoUrl =
  'https://raw.githubusercontent.com/deldersveld/topojson/master/world-countries.json';

  const visitedCountries = ['FRA', 'ISR', 'USA']; // ISO 3166-1 alpha-3 codes


function Home() {
  return (
    <div style={{ padding: '2rem' }}>
      <h1>Welcome to NextTrip</h1>
      <p>Discover and rate your travel experiences. Get personalized travel recommendations!</p>

      <div style={{ maxWidth: '800px', margin: '2rem auto' }}>
        <ComposableMap projection="geoMercator">
          <Geographies geography={geoUrl}>
            {({ geographies }) =>
              geographies.map((geo) => (
                <Geography
                  key={geo.rsmKey}
                  geography={geo}
                  style={{
                    default: {
                      fill: "#D6D6DA",
                      outline: "none",
                    },
                    hover: {
                      fill: "#F53",
                      outline: "none",
                    },
                    pressed: {
                      fill: "#E42",
                      outline: "none",
                    },
                  }}
                />
              ))
            }
          </Geographies>
        </ComposableMap>
      </div>
    </div>
  );
}

export default Home;
